// src/components/Wizyta/WizytaList.js
import React, { useState, useEffect } from 'react';
import api from '../../api';

const WizytaList = () => {
  const [wizyty, setWizyty] = useState([]);

  useEffect(() => {
    api.get('/wizyty/')
      .then(response => setWizyty(response.data))
      .catch(error => console.error('Błąd pobierania wizyt:', error));
  }, []);

  return (
    <div>
      <h2>Lista Wizyt</h2>
      <ul>
        {wizyty.map(wizyta => (
          <li key={wizyta.id}>{wizyta.data_i_godzina} - {wizyta.lekarz.imie} {wizyta.lekarz.nazwisko}</li>
        ))}
      </ul>
    </div>
  );
};

export default WizytaList;
